import React, {useState} from "react";
import s from "./Registration.module.css";
import imagecol from "./login_image.png";
import { NavLink } from "react-router-dom";

export default function Registration({setIsLoggedIn, isLoggedIn}) {
    const [Email, setEmail] = useState("");
    const [Password, setPassword] = useState("");
    const [name, setName] = useState("");
    const [phone, setPhone] = useState("");
    const [birthday, setBirthday] = useState("");

    async function registration(e) {
        e.preventDefault();
        let result = await fetch("https://craftcutstestapiproject20211120225609.azurewebsites.net/api/Customer/RegistrationWeb", {
            method: 'POST',
            headers: {
                "Content-Type": "application/json",
                "Accept": "application/json",
            },
            // body: JSON.stringify({Name: name, Password: Password, Email: Email, Phone: phone, Birthday: birthday}),
            body: JSON.stringify({name, Password, Email, phone, birthday}),
        });
        console.log(result);
        console.log(result.status);
        if(result.status === 200){
            console.log({Email, Password});
            result = await result.json();
            localStorage.setItem("user-info", JSON.stringify(result));
            localStorage.setItem('isLoggedIn', true);
            setIsLoggedIn(true);
            history.push("/cabinet")
        }
        else if(result.status == 404){
            setStatusCode(404);
            alert("Неверная почта или пароль");
        }
        else if(result.status == 404){
            setStatusCode(400);
            alert("Пожалуйста, заполните поля");
        }
    }

    return (
        <div>
            <div className={s.row}>
                <div className={s.col_6}>
                    <li className={s.item}>
                       </li>
                    <h5 className={s.h5welcome}>Добро пожаловать в <span className={s.craftcuts_red}>Craft Cuts</span>
                        <h6 className = "mb-5">У вас уже есть аккаунт? Войдите <NavLink to="/login">здесь</NavLink></h6>
                    </h5>
                    <form onSubmit={registration} className={s.formControl}>
                    <h1 className={s.login}>Зарегистрироваться</h1>
                    <div className={s.Login}>
                    <div className="mb-3">
                        <h4>Введите ваше имя</h4>
                        <input type="text" placeholder="name" onChange={(e)=>setName(e.target.value)} className="w-75" />
                    </div>
                        <div className="mb-4">
                        <h4>Введите вашу почту</h4>
                            <input type="email" placeholder="mail" onChange={(e)=>setEmail(e.target.value)} className="w-75" />
                        </div>  
                        <div className="mb-4">
                        <h4>Введите ваш номер телефона</h4>
                        <input type="text" placeholder="phone" onChange={(e)=>setPhone(e.target.value)} className="w-75" />
                    </div>
                    <div className="mb-4">
                        <h4>Придумайте свой пароль</h4>
                        <input type="password" placeholder="password" onChange={(e)=>setPassword(e.target.value)} className="w-75" />
                    </div>
                    <div className="mb-4">
                         <h4>Введите дату рождения</h4>
                         <input type="datetime-local" placeholder="password" onChange={(e)=>setBirthday(e.target.value)} className="w-75" />
                    </div>
                        <button type="submit" className={s.btn_login}>Registration </button>
                        {/*<button onClick={registration} className={s.btn_login}>Registration</button>*/}
                        {/*<NavLink to = "/cabinet" block size="lg" className={s.btn_login}>*/}
                        {/*    Login*/}
                        {/*</NavLink>*/}

                    </div>
            </form>
                </div>
                <div className={s.col_6}>
                    <div className={s.img_block}>
                        <img className={s.imagecol} src={imagecol} alt="image_left"></img></div>
                </div>
            </div>
        </div>
    );
}
